import React from "react";
import ReactDOM from "react-dom/client";
import App from "./App";
import axios from "axios";
import findLocalIp from "../../backend/src/utils/findLocalIp";
import config from "./config";

const root = ReactDOM.createRoot(document.getElementById("root"));
let backendAdress = `http://${findLocalIp()}:${config.port}`;

axios
  .get(backendAdress)
  .then((res) => {
    if (res.status === 200) {
      root.render(
        <React.StrictMode>
          <App />
        </React.StrictMode>
      );
    }
  })
  .catch((error) => {
    console.log(error);
  });
